import Nav from 'react-bootstrap/Nav'

let navBarElements = ["Inicio", "Productos", "Carrito"]

function NavBarItems() {
    return (
        navBarElements.map(element => <Nav.Link href="#element">{element}</Nav.Link>)
    )
}

export default NavBarItems
